#define NV_CTRL_CMD_TABLE_SIZE (sizeof(g_nvCtrlCmdTable) / sizeof(g_nvCtrlCmdTable[0]) - 1)

/* 查找命令名称 */
static inline const char* nv_lookup_ctrl_cmd_name(uint32_t cmd)
{
    /* 二分查找 */
    int left = 0;
    int right = NV_CTRL_CMD_TABLE_SIZE - 1;
    
    while (left <= right) {
        int mid = (left + right) / 2;
        if (g_nvCtrlCmdTable[mid].cmd == cmd) {
            return g_nvCtrlCmdTable[mid].name;
        } else if (g_nvCtrlCmdTable[mid].cmd < cmd) {
            left = mid + 1;
        } else {
            right = mid - 1;
        }
    }
    return NULL;
}

/* 获取命令的完整描述 */
static inline void nv_get_ctrl_cmd_info(uint32_t cmd, char *buf, size_t buflen)
{
    const char *name = nv_lookup_ctrl_cmd_name(cmd);
    const char *cls_name = nv_get_cmd_class_name(cmd);
    const char *cat_name = nv_get_cmd_category_name(cmd);
    
    if (name) {
        snprintf(buf, buflen, "%s [%s::%s]", name, cls_name, cat_name);
    } else {
        snprintf(buf, buflen, "UNKNOWN_CMD_0x%08X [%s::%s]", cmd, cls_name, cat_name);
    }
}

